The year, 2006. The mission, to design my 3 year old's bedroom to be thoughtful, childlike, and playful and yet fit within the aesthetic of the rest of our home. Little did I know this endeavor would peak my interest in design, and become the first ever product I conceived — a live edge growth chart. Sent me back to school, inspired an internship, launched a design business, and became that gateway into a new career.  BUT, this post is not about me. It’s about Jivan.  And the many bedrooms he and I have designed together over the years. I have always believed that a 3 year old, a 6 year old, a 10 year old, and an 18 year old all deserve a sacred and private space that they had a hand in crafting. A safe place, a playspace, a workshop, a place to create, a place to brood, a place to decompress, a place to dream. A space to call their own.

Fast forward to 2021, here we are at this unfathomable crossroads and a new design endeavor —  Jivan’s college dorm room. Perhaps it is time for me to take a back seat in his very adult and independent space. BUT, I’ll hang on to mommy-ing just a lil bit longer — can’t help myself! I have hounded Jivan for the past weeks to sit down and give me 2 hours (between work & surf) to select his dorm room essentials. I felt it was only right to share our choices with other parents who are navigating this precious and transitional adult moment with their child.  Stylish dorm room décor essentials on today’s Eye-Swoon.com

@jivancalderone we are pulling out that growth chart for one last measure before you go! 📏
